import React, { useState, useEffect } from 'react';
import { useInventory } from '../context/InventoryContext'; // Update the path if InventoryContext.js is in a different folder

const ProductManagement = () => {
  const { products, setProducts, addProduct, updateProduct, deleteProduct, updateProducts } = useInventory(); // Destructure methods from context
  const [productForm, setProductForm] = useState({
    name: '',
    description: '',
    category: '',
    price: '',
    quantity: '',
  });
  const [isEditing, setIsEditing] = useState(false);
  const [editingProductId, setEditingProductId] = useState(null);

  // Handle form input changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setProductForm((prev) => ({ ...prev, [name]: value }));
  };

  // Handle form submission (Add or Update Product)
  const handleSubmit = async (e) => {
    e.preventDefault();
    if (isEditing) {
      // Update existing product
      try {
        await updateProduct({ id: editingProductId, ...productForm }); // Call updateProduct from context
        await updateProducts(); // Ensure products are updated from the backend
        setIsEditing(false);
        setEditingProductId(null);
      } catch (error) {
        console.error('Error updating product:', error);
      }
    } else {
      // Add new product
      try {
        await addProduct(productForm); // Call addProduct from context
        await updateProducts(); // Ensure products are updated from the backend
      } catch (error) {
        console.error('Error adding product:', error);
      }
    }
    // Reset form after submission
    setProductForm({ name: '', description: '', category: '', price: '', quantity: '' });
  };

  // Handle Edit button click
  const handleEdit = (product) => {
    setProductForm(product);
    setIsEditing(true);
    setEditingProductId(product.id);
  };

  // Handle Delete button click
  const handleDelete = async (id) => {
    try {
      await deleteProduct(id); // Call deleteProduct from context
      await updateProducts(); // Ensure products are updated from the backend
    } catch (error) {
      console.error('Error deleting product:', error);
    }
  };

  return (
    <div>
      <h1>Product Management</h1>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="name"
          value={productForm.name}
          onChange={handleChange}
          placeholder="Product Name"
          required
        />
        <input
          type="text"
          name="description"
          value={productForm.description}
          onChange={handleChange}
          placeholder="Description"
          required
        />
        <input
          type="text"
          name="category"
          value={productForm.category}
          onChange={handleChange}
          placeholder="Category"
          required
        />
        <input
          type="number"
          name="price"
          value={productForm.price}
          onChange={handleChange}
          placeholder="Price"
          required
        />
        <input
          type="number"
          name="quantity"
          value={productForm.quantity}
          onChange={handleChange}
          placeholder="Initial Quantity"
          required
        />
        <button type="submit">{isEditing ? 'Update Product' : 'Add Product'}</button>
      </form>

      <h2>Products</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Description</th>
            <th>Category</th>
            <th>Price</th>
            <th>Quantity</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {products.map((product) => (
            <tr key={product.id}>
              <td>{product.name}</td>
              <td>{product.description}</td>
              <td>{product.category}</td>
              <td>M{product.price}</td>
              <td>{product.quantity}</td>
              <td>
                <button onClick={() => handleEdit(product)}>Edit</button>
                <button onClick={() => handleDelete(product.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ProductManagement;
